import { Button, Form, FormGroup, Label, Input } from 'reactstrap';
import React from 'react';

class Navbar extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
        <Form inline>
            <FormGroup className="w-25 align-center">
                <Input placeholder="Search Images" width="100%"></Input>
            </FormGroup>
        </Form>
        );
    }
}

export default Navbar
